import Navbar from "./components/Navbar";
import Leftbar from './components/Leftbar';
import { BaseRoute } from "./utils/Routes";

function App() {
  return (
    <div className="App">

      <Navbar />

      <Routes>
        <BaseRoute path={"/"} element={<Leftbar />}>

        </BaseRoute>

        <Route element={<Leftbar />}>
          <Route path="/askquestion" element={<Form />} />
        </Route>
      </Routes>
      {/* LayoutRoute */}


      <ul>
        <li>
          <Link to={"/questionform"}>Ask</Link>
        </li>
      </ul>
    </div>
  );
}

export default App;
